    <style>
        .glow-on-hover1 {
            width: 220px;
            height: 50px;
            border: none;
            outline: none;
            color: #fff;
            background: #111;
            cursor: pointer;
            position: relative;
            z-index: 0;
            border-radius: 10px;
        }

        .glow-on-hover1:before {
            content: '';
            background: linear-gradient(45deg, #7338AC, #635AD9, #219BE4, #88F4FF, #00ffd5, #8adeff, #63fff2, #4ff7e9, #00ffd0);
            position: absolute;
            top: -2px;
            left: -2px;
            background-size: 400%;
            z-index: -1;
            filter: blur(5px);
            width: calc(100% + 4px);
            height: calc(100% + 4px);
            animation: glowing 20s linear infinite;
            opacity: 0;
            transition: opacity .3s ease-in-out;
            border-radius: 10px;
        }



        .glow-on-hover1:active {
            color: #000
        }

        .glow-on-hover1:active:after {
            background: transparent;
        }

        .glow-on-hover1:hover:before {
            opacity: 1;
        }

        .glow-on-hover1:after {
            z-index: -1;
            content: '';
            position: absolute;
            width: 100%;
            height: 100%;
            background: #111;
            left: 0;
            top: 0;
            border-radius: 10px;
        }

        @keyframes glowing {
            0% {
                background-position: 0 0;
            }

            50% {
                background-position: 400% 0;
            }

            100% {
                background-position: 0 0;
            }
        }
    </style>
